import axios from "axios";
import React, { useEffect, useState } from "react";
import CoffeeShopCard from "./CoffeeShopCard";
import  Row from "react-bootstrap/Row";
import  Col from "react-bootstrap/Col";



const RenderCoffeeShop = ( props ) => {
    const [ coffeeShops, setCoffeeShops ] = useState([])

    useEffect(() => {
        const location = props.location
        axios.get(`/google_places?city=${location.city}&country_code=${location.country_code}&country_name=${location.country_name}&latitude=${location.latitude}&longitude=${location.longitude}&postal=${location.postal}&state=${location.state}`)
        .then((res) => {
            setCoffeeShops(res.data)
        })
    }, [props.location])

    const renderCoffeeShops = () => {
        return coffeeShops.map((coffeeShop, idx) => {
            console.log(`props.location: ${props.location}`,`coffeeShop: ${props.location}`)
            return( 
                <Col >
                    <CoffeeShopCard  location={props.location} key={idx} coffeeShop={coffeeShop} />
                </Col>
            )
        })

    };

    return (
        <Row>
            {renderCoffeeShops()}
        </Row>
    )

}

export default RenderCoffeeShop
